import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Pagination, Navigation } from 'swiper/modules';
import { useState } from 'react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

function AdminUpdateModalEditImage() {
    const clubImages = [
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/zd6d4satgsidaeaxc8ue.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/b4fjbdhmkdmsq2ffehgi.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/nvkoyua56tumstmtmntn.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690373093/t5hz1iea4blg5hlqkdv4.jpg"
    ]
    return (
        <div className='container-md'>
            <Swiper
                pagination={{
                    type: 'progressbar',
                }}
                navigation={true}
                modules={[Pagination, Navigation]}
                className="mySwiper"
            >
                {
                    clubImages.map((img, index) => (
                        <SwiperSlide className='aspect-w-16 aspect-h-9'>
                            <img className='object-fit' src={img} />
                        </SwiperSlide>
                    ))
                }
            </Swiper>
        </div>
    )
}

export default AdminUpdateModalEditImage
